import './Components.css';

const Navbar = ({ name }) => {

    return (
        <nav class="navbar bg-body-tertiary our-navbar">

        <div class="container-fluid">
          <span class="navbar-text">
          Welcome, {name} (Admin)!
          </span>
        </div>
      </nav>
    )
}

export default Navbar
